import styled from "styled-components";

import HorizontalLine from "../../../HorizontalLine";

import Row from "./Row";

const ContainerTable = styled.div`
  width: 100%;
  height: 10px;
`;

const Table = ({ widthCells, primaryRowData, rowsData }) => {
  return (
    <ContainerTable>
      <HorizontalLine />
      <Row widthCells={widthCells} primaryRowData={primaryRowData} />
      {rowsData.map((rowData) => (
        <Row widthCells={widthCells} rowData={rowData} />
      ))}
    </ContainerTable>
  );
};

export default Table;
